import React, { useState, useEffect } from 'react';
import { Nav, Navbar, NavDropdown } from 'react-bootstrap';
import styled from 'styled-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCashRegister, faHome, faAddressCard, faListAlt, faSignInAlt, faSignOutAlt } from '@fortawesome/free-solid-svg-icons';
import { faReact } from '@fortawesome/free-brands-svg-icons';
import Popup from "reactjs-popup";
import Signin from "./Signin";
import LoggedIn from "./LoggedIn";
import axios from 'axios';
import { Link } from 'react-router-dom';


const Styles = styled.div`
    .navbar {
        background-color:rgba(255, 255, 255, 0.8);
    }

    .navbar-brand, .navbar-nav, .nav-link {
        color: rgba(0, 0, 0, 0.5); !important;

        &:hover {
            color: white !important;
        }
    }
`;


const Modal = styled.div`
    font-size: 12px;
    color: grey;
    width: none !important; 

    .header {
        width: 100%;
        padding: 10px;
        color: #E65950;
        text-align: left;
    }

    .popup-content {
        width: 10% !important;
    }

    .content {
        padding: 10px 5px;
        margin: 0 auto;
    }

    .close {
        cursor: pointer;
        position: absolute;
        display: block;
        padding: 2px 5px;
        line-height: 20px;
        right: -10px;
        top: -10px;
        font-size: 24px;
        background: #ffffff;
        border-radius: 18px;
        border: 1px solid #cfcece;
    }

    button {
        margin: 15px;
    }

    label {
        width: 100%;
        text-align: left;
        color: black;
        font-weight: bold;
    }
`;






const NavigationBar = ({history}) => {
    useEffect(() => {
        fetchItems();


    }, []);

    const [token, setToken] = useState(null);
    const storage = localStorage.getItem('token');

    useEffect(() => {
        if (storage === null || storage.length === 0) {
            setToken(null)
        } else {
            setToken(storage);
        }
    }, [storage]);

    const [items, setItems] = useState([]);

    const fetchItems = async () => {
        const response = await axios.get(`${process.env.REACT_APP_BACKEND_URL}/titles`);
        const items = await response.data;

        setItems(items.data);
    };


    return (
        <>
            <Styles>
                <Navbar expand="lg">
                    <Navbar.Brand href="/">
                        <FontAwesomeIcon icon={faHome} />
                        <span /> Home
                    </Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="ml-auto">
                            <Nav.Item>
                                <Nav.Link href="/about">
                                    <FontAwesomeIcon icon={faAddressCard} />
                                    <span /> About    
                                </Nav.Link>
                            </Nav.Item>
                                {token ? 
                                <Nav.Item>
                                    <Nav.Link href="/reports/create">
                                        <FontAwesomeIcon icon={faAddressCard} />
                                        <span /> Create
                                    </Nav.Link>
                                </Nav.Item>
                                    : 
                                    ""
                                }
                            <NavDropdown title={<span><FontAwesomeIcon icon={faListAlt} /> Reports</span>} id="basic-nav-dropdown">
                                {items.map(item => (
                                    <li key={item.title}>
                                        <Link to={`/reports/week/${item.title}`}> {item.title} </Link>
                                    </li>
                                ))}
                            </NavDropdown>
                            {token ? 
                                ""
                            : <Nav.Item>
                                    <Nav.Link href="/register">
                                        <FontAwesomeIcon icon={faCashRegister} />
                                        <span /> Register
                                </Nav.Link>
                                </Nav.Item> } 
                            {token ? 
                            <Nav.Item>
                                    <Nav.Link onClick={() => { localStorage.removeItem('token'); setToken(null); }}>
                                    <FontAwesomeIcon icon={faSignOutAlt} />
                                    <span /> Sign out
                                </Nav.Link>
                            </Nav.Item>
                            : 
                            <Nav.Item >
                                    <Popup
                                        trigger={
                                            <Nav.Link>
                                                <FontAwesomeIcon icon={faSignInAlt} />
                                                <span /> Sign in
                                        </Nav.Link>
                                        }
                                        modal
                                        closeOnDocumentClick>
                                        {close => (
                                            <Modal>
                                                <button className="close" onClick={close}>
                                                    &times;
                                            </button>
                                                <Signin history={history} closeMe={close} />
                                            </Modal>
                                        )}
                                    </Popup>
                            </Nav.Item>}
                        </Nav>
                    </Navbar.Collapse>
                </Navbar>
                {token ? <LoggedIn /> : "" } 
            </Styles>
        </>    
    )};

export default NavigationBar;
